import React, { Component } from 'react';

export default class Landing extends Component {

	render() {
		return (
			<div className="about-me">
				<h2>About Me</h2>
				<h3>Rachel Bull</h3>
				<div className="cartoon-rachel">

				</div>
				<p>I am a Front End Web Developer from London with 5 years experience in coding responsive web solutions for multiple platforms. I enjoy being creative and using code to inspire myself and others to explore new coding languages.</p>
			</div>
		)
	}
}
